import './ExpanseDate.css';

function ExpanseDate(props) {
    const month = props.date.getMonth()
    const day = props.date.getDay()
    const year = props.date.getFullYear();

    return <div>
        <div>{month}</div>
        <div>{year}</div>
        <div>{day}</div>
    </div>
}

export default ExpanseDate
